import { createContext, useContext } from 'react'

const theme = {
    primary: 'red',
    secondary: 'blue'
}

export const createTheme = (props) => (createContext(props))

const ThemeProvider = (props) => (
    <ThemeContext.Provider value={theme}>
        {props.children}
    </ThemeContext.Provider>
)

export default ThemeProvider
